window.timeServerJS={StartWS:function(){try{ws=new WebSocket("wss://prs.tvsi.com.vn/datarealtime"),ws.onopen=function(e){console.log(new Date),console.log("Timer WS Connected")},ws.onmessage=function(e){var o=JSON.parse(LZString.decompressFromBase64(e.data));if(o&&o.length>0){var n=o.find((e=>10===e.Code&&""!==e.Msg));n&&($("#clock-date").html(n.Msg.substring(0,10)),$("#clock-time").html(n.Msg.substring(11,19)))}},ws.onerror=function(e){console.log(new Date),console.log("Timer WS error: "+e.message)},ws.onclose=function(e){console.log(new Date),console.log("Timer WS disconnected"),window.timeServerJS.StartWS()}}catch(e){console.log(e)}}},document.addEventListener("DOMContentLoaded",(function(e){window.timeServerJS.StartWS()}));